import React from 'react';
import PropTypes from 'prop-types';

const Textbox = initial_text => {
  return (
    <div>
      <textarea
        rows='4'
        cols='50'
        name='comment'
        form='usrform'
        placeholder={initial_text}
        className='#ffebee red lighten-5'
        style={{ height: '500px' }}
      />
    </div>
  );
};
Textbox.propTypes = {
  initial_text: PropTypes.string.isRequired
};

export default Textbox;
